const ResetPassword1 = () => {
  return (
    <React.Fragment>
      {/* <Breadcrumb /> */}
      <div className="auth-wrapper">
        <div className="auth-content">
          <div >
            <span className="r" />
            <span className="r s" />
            <span className="r s" />
            <span className="r" />
          </div>
          <Card className="borderless">
            <Row className="align-items-center text-center">
              <Col>
                <Card.Body className="card-body">
                  <div className="mb-4">
                    <i className="feather icon-mail auth-icon" />
                  </div>
                  <h3 className="mb-3 f-w-400">Reset Password</h3>
                  <div className="input-group mb-4">
                    <input type="text" className="form-control" placeholder="Employee code" />
                  </div>
                  <button className="btn btn-primary mb-4">Reset password</button>

                </Card.Body>
              </Col>
            </Row>
          </Card>
        </div>
      </div>
    </React.Fragment>
  );
};

export default ResetPassword1;
